import React, { useState, useEffect } from 'react';
import api from '../api/api';
import ClientLayout from '../components/ClientLayout'; // 游 Importar Layout

function AnalisisNegocio() {
    const [analysisData, setAnalysisData] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) return; 

        const config = { headers: { Authorization: `Bearer ${token}` } };

        api.get('/analysis/me', config)
            .then(res => {
                setAnalysisData(res.data);
                setLoading(false);
            })
            .catch(err => {
                console.error('Error fetching analysis data', err);
                setLoading(false);
            });
    }, []);

    const contentStyle = {
        width: '100%', 
        maxWidth: 800, 
        padding: 25, // Aumentar padding
        background: '#334155', // Fondo de tarjeta oscuro
        borderRadius: 12, 
        boxShadow: '0 4px 10px rgba(0,0,0,0.3)',
        color: '#fff'
    };
    
    // Estilo para tarjetas KPI dentro de la p치gina
    const innerCardStyle = { 
        padding: 15, 
        background: '#1e293b', 
        borderRadius: 8, 
        borderLeft: '4px solid #a78Bfa' 
    };

    return (
        <ClientLayout title="An치lisis de Negocio"> {/* 游 Usar ClientLayout con t칤tulo */}
            <div style={contentStyle}>
                <h3 style={{ color: '#7dd3fc', borderBottom: '1px solid #475569', paddingBottom: 10, margin: '0 0 20px 0' }}>Tu Desempe침o y Consumo</h3>
                
                {loading && <p>Cargando datos de an치lisis...</p>}
                
                {!loading && analysisData && (
                    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: 20 }}>
                        
                        <div style={{...innerCardStyle, borderLeftColor: '#f59e0b'}}>
                            <p style={{ color: '#94a3b8', margin: 0 }}>Total de Pedidos</p>
                            <h4 style={{ color: '#f59e0b', fontSize: 24, margin: '5px 0 0 0' }}>{analysisData.totalPedidos}</h4>
                        </div>
                        
                        <div style={{...innerCardStyle, borderLeftColor: '#10b981'}}>
                            <p style={{ color: '#94a3b8', margin: 0 }}>Kg Consumidos (칰lt. 12m)</p>
                            <h4 style={{ color: '#10b981', fontSize: 24, margin: '5px 0 0 0' }}>{analysisData.kgConsumidos} Kg</h4>
                        </div>
                        
                        <div style={{...innerCardStyle, borderLeftColor: '#a78Bfa'}}>
                            <p style={{ color: '#94a3b8', margin: 0 }}>Gasto Total (칰lt. 12m)</p>
                            <h4 style={{ color: '#a78Bfa', fontSize: 24, margin: '5px 0 0 0' }}>${analysisData.gastoTotal}</h4>
                        </div>
                        
                        <div style={{...innerCardStyle, borderLeftColor: '#ef4444'}}>
                            <p style={{ color: '#94a3b8', margin: 0 }}>Frecuencia (d칤as)</p>
                            <h4 style={{ color: '#ef4444', fontSize: 24, margin: '5px 0 0 0' }}>{analysisData.frecuencia}</h4>
                        </div>
                        
                        {/* Ejemplo de gr치fico o tabla */}
                        <div style={{ gridColumn: '1 / -1', marginTop: 20, borderTop: '1px solid #475569', paddingTop: 20 }}>
                            <h4 style={{ color: '#cbd5e1' }}>Gr치fico de Consumo Mensual (simulado)</h4>
                            <div style={{ height: 250, background: '#1e293b', borderRadius: 8, display: 'flex', justifyContent: 'center', alignItems: 'center', color: '#64748b', fontSize: 14 }}>
                                [Gr치fico de Barras o L칤neas aqu칤 - Reemplazar con Chart.js/otro]
                            </div>
                        </div>
                    </div>
                )}

                {!loading && !analysisData && <p>No se encontraron datos de an치lisis.</p>}

            </div>
        </ClientLayout>
    );
}

export default AnalisisNegocio;
